import React from 'react';

import Grid from '@material-ui/core/Grid';



const services = props => {
  return (
    <div className="">
        
        <Grid container  >
        <Grid item md={2} xs={1}>
      </Grid>
      <Grid container md={8} xs={10}>
          <Grid item md={3}></Grid>
      <Grid container md={6}className="center">
          <h2>Our mission</h2>
          </Grid>
          <Grid item md={3}></Grid>
      </Grid>
      
      <Grid item md={2}>
      </Grid>
      </Grid>
</div>
  );
    
};

export default services;
